import './NavBar.css'
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Button from '@mui/material/Button';
import { createTheme } from '@mui/material/styles';
import CartWidget from '../CartWidget/CartWidget';
import { ShoppingCart } from '@mui/icons-material';

//UpperCamelCase
const NavBar = ()=>{
    return (
            <AppBar position="static">
                <Toolbar className="navbar">
                    <div className="container-logo">
                    <img src="./LogoAlmacen.png"/>
                    </div>
                    <div>
                        <Button className='btn-navbar' color='success'>Home</Button>
                        <Button className='btn-navbar' color='success'>Shop</Button>
                        <Button className='btn-navbar' color='success'>Contacto</Button>     
                        <Button className='btn-navbar' color='success'>Login</Button>                                      
                    </div>
                        <Button><ShoppingCartIcon/></Button>
                </Toolbar>
            </AppBar>
    )
}

export default NavBar
